import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import { AppProvider } from "./context/AppContext";
import { ToastContainer } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";
import Navbar from "./components/Navbar";
import Home from "./components/Home";
import Login from "./components/Login";
import Register from "./components/Register";
import SectionManagement from "./components/SectionManagement";
import EbookManagement from "./components/EbookManagement";
import RequestManagement from "./components/RequestManagement";
import FeedbackManagement from "./components/FeedbackManagement";
import EbookDetail from "./components/EbookDetail";
import AvailableBooks from "./components/AvailableBooks";
import UserProfile from "./components/UserProfile";
import NotFound from "./components/NotFound";
import Footer from "./components/Footer";
import "./index.css";

// Simple mock of PrivateRoute, assuming no DB and only role-based logic
const PrivateRoute = ({ role, children }) => {
  // In the real scenario, you would retrieve the logged-in user from context or local storage
  const loggedInRole = localStorage.getItem("role"); // Example: get role from localStorage

  if (loggedInRole === role) {
    return children;
  }

  return <NotFound />; // If not authorized, show 404 page
};

const App = () => {
  return (
    <AppProvider>
      <Router>
        <div className="main-container">
          <Navbar />
          <div className="content">
            <ToastContainer position="top-center" autoClose={1000} />
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/login" element={<Login />} />
              <Route path="/register" element={<Register />} />

              {/* For librarian routes, we assume the role is stored in localStorage */}
              <Route
                path="/librarian"
                element={
                  <PrivateRoute role="librarian">
                    <SectionManagement />
                  </PrivateRoute>
                }
              />
              <Route
                path="/manage-sections"
                element={
                  <PrivateRoute role="librarian">
                    <SectionManagement />
                  </PrivateRoute>
                }
              />
              <Route
                path="/manage-ebooks"
                element={
                  <PrivateRoute role="librarian">
                    <EbookManagement />
                  </PrivateRoute>
                }
              />
              <Route
                path="/manage-requests"
                element={
                  <PrivateRoute role="librarian">
                    <RequestManagement />
                  </PrivateRoute>
                }
              />
              <Route
                path="/manage-feedbacks"
                element={
                  <PrivateRoute role="librarian">
                    <FeedbackManagement />
                  </PrivateRoute>
                }
              />

              {/* For user routes */}
              <Route
                path="/ebook/:id"
                element={
                  <PrivateRoute role="user">
                    <EbookDetail />
                  </PrivateRoute>
                }
              />
              <Route
                path="/available-books"
                element={
                  <PrivateRoute role="user">
                    <AvailableBooks />
                  </PrivateRoute>
                }
              />
              <Route
                path="/profile"
                element={
                  <PrivateRoute role="user">
                    <UserProfile />
                  </PrivateRoute>
                }
              />

              {/* 404 page */}
              <Route path="*" element={<NotFound />} />
            </Routes>
          </div>
          <Footer />
        </div>
      </Router>
    </AppProvider>
  );
};

export default App;
